  input: TEXT,F3XA,,"This memo is submitted in response to your inquiry dated October
    2, 2002, in which five contributions for the period April 1, 2002 - June 30, 2002
    were questioned.  We have reviewed each of the five transactions, and determined
    that all should have been designated as contributions in support of 2002 General
    Elections rather than 2002 Primary Elections.  Unfortunately, the staff who initiated
    those transactions miscommunicated the designations at the time they were executed.  We
    have corrected each of the five transactions to reflect their correct status.  Consequently,
    no refunds were necessary or made.  We regret any confusion caused by the mistaken
    designations.  Should you have any questions regarding this amended report, please
    feel free to call me during the week at (202) 418-2230.  Thank you. -- Warren
    O'Hearn, Director of Finance, The National PAC"
